import React, { Component } from "react";

class Customer extends React.Component {
    render () {
        return (
        <div>
            <h2>Brandon</h2>
            <p>1988/11/07</p>
            <p>Male</p>
            <p>Student</p>
        </div>
        )
    }
}

export default Customer;
